sys_variable_value.value:
(function execute(inputs, outputs) {
    var devices = [];
  	var returnedObject = JSON.parse(inputs.responseBody);
    var deviceArray = returnedObject.Devices;
    for (var i=0; i<deviceArray.length; i++) {
      var deviceObject = deviceArray[i];
      var device = {};
      device.uuid = deviceObject.Uuid;
      device.username = deviceObject.UserName;
      device.useremailaddress = deviceObject.UserEmailAddress;
      device.devicereportedname = deviceObject.DeviceReportedName;
      device.locationgroupname =  deviceObject.LocationGroupName;
      device.Udid = deviceObject.Udid;
      device.platform = deviceObject.Platform;
      device.ws1webpage =  "http://www.vmware.com";
      devices.push(device);
    }
  outputs.devices = devices;
})(inputs, outputs);

